import React from 'react';
import './index.css'

const Home = () => {
    return (
      <div class="whole-container">
      <div class="left-container">
      <h1 class="center-title">Welcome To GG's</h1>
      <p class="phrase">We provide the best online services for new or used Console, Games, and Accessories!</p>

      </div>
      <Slider/>
      </div>
    )
  }

  export default Home
